use std::io;
use std::thread;
use std::time::Duration;

use reqwest;
use serde_json::json;
use tokio;
use tokio_tungstenite::connect_async;
use tungstenite::Message;

// Function to read clipboard contents
async fn read_clipboard() -> String {
    // Use the `clipboard` crate to read the clipboard contents
    let clipboard = clipboard::ClipboardContext::new().unwrap();
    let contents = clipboard.get_contents().unwrap();
    contents
}

// Function to send clipboard contents to the elevenlabs.io API
async fn send_to_api(contents: String) -> String {
    // Set the API endpoint and API key
    let endpoint = "https://api.elevenlabs.io/v1/text-to-speech";
    let api_key = "YOUR_API_KEY_HERE";

    // Create a JSON payload with the clipboard contents
    let payload = json!({
        "text": contents,
        "voice": "en-US-Wavenet-C"
    });

    // Send a POST request to the API endpoint with the JSON payload
    let client = reqwest::Client::new();
    let response = client
        .post(endpoint)
        .header("Authorization", format!("Bearer {}", api_key))
        .header("Content-Type", "application/json")
        .body(payload.to_string())
        .send()
        .await
        .unwrap();

    // Get the audio response from the API
    let audio_response = response.text().await.unwrap();

    audio_response
}

